import styled from 'styled-components';

export default styled.button`
	background-color: #4B4B4B;
	border: 0px;
	color: white;
	font-size: 1em;
	font-weight: bold;
	padding: 0px 10px 8px 10px;
	border-radius: 5px;

	&:hover {
		background-color: #333333;
	}
`;
